import React from "react";
import ReactDOM from "react-dom";
import Header from "./components/Header";
import Index from "index";
import "./main.css";

function header() {
  return (
    <Route exact path="/">
      <Index />
    </Route>
  );
}

ReactDOM.render(header(), document.getElementById("root"));
render(
  <BrowserRouter>
    <Index />
  </BrowserRouter>,
  document.getElementById("root")
);
